jQuery(document).ready(function(){function t(){const t=new Date,r=e.getTime()-t.getTime();if(r<=0){if(n)n.textContent="00";if(o)o.textContent="00";if(a)a.textContent="00";if(m)m.textContent="00";return}const d=Math.floor(r/864e5),l=Math.floor(r%864e5/36e5),s=Math.floor(r%36e5/6e4),c=Math.floor(r%6e4/1e3);if(n)n.textContent=d.toString().padStart(2,"0");if(o)o.textContent=l.toString().padStart(2,"0");if(a)a.textContent=s.toString().padStart(2,"0");if(m)m.textContent=c.toString().padStart(2,"0")}const e=new Date("2025-01-05T23:59:59"),n=document.getElementById("mo-saml-days"),o=document.getElementById("mo-saml-hours"),a=document.getElementById("mo-saml-minutes"),m=document.getElementById("mo-saml-seconds");if(n||o||a||m){setInterval(t,1e3);t()}});